(55, 3, 1, 1, 0, '<p>Riset Universitas Nusa Cendana menunjukkan, mangga kelapa pulau Alor kaya vitamin C. Setiap 100 g daging buah mengandung 31,91 mg vitamin C. Artinya, cukup dengan menyantap 200 g alias sperempat buah mangga alor, maka kebutuhan asupan vitamin C untuk laki-laki dan perempuan dewasa sebanyak 60 mg per hari dapat terpenuhi.</p><p>Bila musim berbuah tiba, Mangifera indica itu jadi incaran para wisatawan dan pejabat yang berkunjung ke kabupaten paling timur di Provinsi NTT itu. Rombongan pejabat juga tidak ketinggalan untuk selalu mampir ke tempat tersebut. Rasanya yang manis dan ukuran superbesar membuat mangga itu menjadi oleh-oleh khas Alor yang paling digemari. Pada Oktober 2008 mangga kelapa asal pulau seribu Moko (julukan Pulau Alor) itu resmi ditetapkan sebagai salah satu varietas unggul lokal. Namanya pun berganti, `Sekarang namanya mangga alor bukan mangga kelapa lagi’, kata Ir Johannis Francis, kepala Badan Ketahanan Pangan dan Penyuluhan Pertanian Kabupaten Alor. Untuk pengembangan bibit, pohon mangga alor milik Hamid Eta yang menjuarai kontes dipilih menjadi pohon induk. Dari pohon berumur 18 tahun itulah nantinya akan dikembangkan bibit-bibit mangga alor. (Disadur dari berbagai sumber – Subunit TPA)</p><p>&nbsp;Ide pokok paragraf terakhir dari bacaan diatas adalah...&nbsp;<br></p>'),
(56, 3, 1, 1, 0, '<p>Riset Universitas Nusa Cendana menunjukkan, mangga kelapa pulau Alor kaya vitamin C. Setiap 100 g daging buah mengandung 31,91 mg vitamin C. Artinya, cukup dengan menyantap 200 g alias sperempat buah mangga alor, maka kebutuhan asupan vitamin C untuk laki-laki dan perempuan dewasa sebanyak 60 mg per hari dapat terpenuhi.</p><p>Bila musim berbuah tiba, Mangifera indica itu jadi incaran para wisatawan dan pejabat yang berkunjung ke kabupaten paling timur di Provinsi NTT itu. Rombongan pejabat juga tidak ketinggalan untuk selalu mampir ke tempat tersebut. Rasanya yang manis dan ukuran superbesar membuat mangga itu menjadi oleh-oleh khas Alor yang paling digemari. Pada Oktober 2008 mangga kelapa asal pulau seribu Moko (julukan Pulau Alor) itu resmi ditetapkan sebagai salah satu varietas unggul lokal. Namanya pun berganti, `Sekarang namanya mangga alor bukan mangga kelapa lagi’, kata Ir Johannis Francis, kepala Badan Ketahanan Pangan dan Penyuluhan Pertanian Kabupaten Alor. Untuk pengembangan bibit, pohon mangga alor milik Hamid Eta yang menjuarai kontes dipilih menjadi pohon induk. Dari pohon berumur 18 tahun itulah nantinya akan dikembangkan bibit-bibit mangga alor. (Disadur dari berbagai sumber – Subunit TPA)</p><div>Pernyataan yang tidak sesuai dengan bacaan diatas adalah....<br></div>'),
