(100, 3, 4, 1, 3, '<p>Sebuah truk harus mengangkut 6 ¼ ton pasir dari sebuah sungai ke lokasi proyek. Apabila truk tersebut hanya mampu mengangkut 500 kg pasir pada setiap kali angkut, berapa kali perjalanan yang harus dilakukan supir truk tersebut untuk mengangkut seluruh pasir?&nbsp;<br></p>'),
