(109, 3, 4, 1, 3, '<p>Setiap hari Indah(I), Joni(J), Kiki(K), Lala(L), Maman(M), dan Nina (N) berangkat sekolah bersama. Mereka berangkat dengan busway dan selalu mengantri tiket dengan ketentuan: </p><ul><li>Joni ada di depan Nina </li><li>Indah selalu di urutan dua atau lima </li><li>Lala antri sesudah Kiki tapi sebelum Nina </li><li>Maman dan Indah dipisahkan oleh tiga anak&nbsp;</li></ul><p>Jika Maman ada di urutan terakhir maka urutan yang mungkin dari baris pertama antrian adalah?&nbsp;<br></p>'),
(110, 3, 4, 1, 3, '<p>Setiap hari Indah(I), Joni(J), Kiki(K), Lala(L), Maman(M), dan Nina (N) berangkat sekolah bersama. Mereka berangkat dengan busway dan selalu mengantri tiket dengan ketentuan:&nbsp;</p><ul><li>Joni ada di depan Nina</li><li>Indah selalu di urutan dua atau lima</li><li>Lala antri sesudah Kiki tapi sebelum Nina</li><li>Maman dan Indah dipisahkan oleh tiga anak&nbsp;</li></ul><p>Jika Nina ingin di urutan lima, maka kemungkinan Maman ada di urutan?&nbsp;<br></p>'),
(111, 3, 4, 1, 3, '<p>Setiap hari Indah(I), Joni(J), Kiki(K), Lala(L), Maman(M), dan Nina (N) berangkat sekolah bersama. Mereka berangkat dengan busway dan selalu mengantri tiket dengan ketentuan: </p><ul><li>Joni ada di depan Nina </li><li>Indah selalu di urutan dua atau lima </li><li>Lala antri sesudah Kiki tapi sebelum Nina </li><li>Maman dan Indah dipisahkan oleh tiga anak&nbsp;</li></ul><p>Jika Joni ada di urutan ketiga, maka yang mungkin ada di urutan keempat adalah...&nbsp;<br></p>'),
