(113, 3, 4, 1, 3, '<p>Kelas D akan memilih seorang murid untuk menjadi ketua kelas. Setiap murid mempunyai kesempatan yang sama untuk dipilih. Peluang laki-laki terpilih sama dengan 2/3 kali peluang terpilihnya seorang murid perempuan. Persentase murid perempuan di kelas tersebut adalah ...<br></p>'),
