(119, 3, 4, 1, 3, '<p>Penderita flu maupunbatuk yang berobat ke klinik Asebanyak66 orang, 25 orang menderita flu, dan 15 orang flu jugabatuk. Banyakpenderita yang hanyamenderitabatukadalah . . .&nbsp;<br></p>'),
(120, 3, 4, 1, 3, '<p>Dalam sebuah kotak berisi kertas yang bertuliskan huruf-huruf dari A sampai Z. Setiap kali pengambilan, kertas yang terpilih dimasukkan kembali ke kotaknya. Dari 130 pengambilan, berapa frekuensi harapan terambilnya huruf vokal?<br></p>'),
(122, 3, 4, 1, 3, '<p>Sally, Sherly, Laura, Tomi, dan Sandy masing-masing mengambil permen dari sebuah mangkok. Pertama, empat anak mengambil permen rasa susu. Kemudian Sherly dan Tomi tidak mengambil permen rasa coklat seperti yang dilakukan anak lainnya. Sherly hanya mengambil satu permen, yaitu permen rasa anggur. Setelah itu, selain Sherly hanya Sally dan Sandy yang tidak mengambil permen rasa kopi.&nbsp;</p><p>Siapa yang mengambil tiga permen?&nbsp;<br></p>'),
(123, 3, 4, 1, 3, '<p>Sally, Sherly, Laura, Tomi, dan Sandy masing-masing mengambil permen dari sebuah mangkok. Pertama, empat anak mengambil permen rasa susu. Kemudian Sherly dan Tomi tidak mengambil permen rasa coklat seperti yang dilakukan anak lainnya. Sherly hanya mengambil satu permen, yaitu permen rasa anggur. Setelah itu, selain Sherly hanya Sally dan Sandy yang tidak mengambil permen rasa kopi.<br></p><p>Siapa dua orang yang mengambil permen dengan jumlah dan rasa yang sama?&nbsp;<br></p>'),
(125, 3, 4, 1, 3, '<p>Sally, Sherly, Laura, Tomi, dan Sandy masing-masing mengambil permen dari sebuah mangkok. Pertama, empat anak mengambil permen rasa susu. Kemudian Sherly dan Tomi tidak mengambil permen rasa coklat seperti yang dilakukan anak lainnya. Sherly hanya mengambil satu permen, yaitu permen rasa anggur. Setelah itu, selain Sherly hanya Sally dan Sandy yang tidak mengambil permen rasa kopi.&nbsp;</p><p>Siapakah yang mengambil satu buah permen rasa kopi dan satu buah permen rasa susu?&nbsp;<br></p>'),
