(161, 3, 5, 1, 3, '<p><span style=\"color: rgb(68, 68, 68); font-family: &quot;Open Sans&quot;, Arial, Helvetica, Ubuntu, sans-serif; font-size: 14px;\">Dwi diminta untuk membentuk kelompok kerja dengan tugas yang cukup rahasia. Sebelum bekerja masing-masing anggota diminta untuk membuat pakta integritas untuk tidak memberitahukan kepada siapapun. Masing-masing anggota memiliki tugas yang cukup spesifik namun cara pengerjaannya mempunyai aturan yang sama. Pada waktu tertentu mereka berkumpul untuk memberikan laporan capaian target. Jika Anda adalah Dwi, hal yang Anda periksa berkaitan dengan hasil kerja adalah ….</span><br></p>'),
(162, 3, 1, 1, 0, '<p>Mahalnya tiket masuk turis ke Tangkuban Perahu harus jadi perhatian serius. Jika terus mahal, bisa-bisa kunjungan turis ke sana berkurang. Hal itu disampaikan Ketua Asosiasi Agen Perjalanan Wisata Indonesia (ASITA) Jawa Barat Budijanto Ardiansjah.&nbsp;</p><p>&nbsp;<span style=\"font-size: 1rem;\">Sumber: travel.detik.com</span></p><p>&nbsp;Ide pokok dari bacaan di atas adalah ...<span style=\"font-size: 1rem;\">&nbsp;</span><br></p>'),
