(173, 3, 2, 1, 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"643\" style=\"width: 482pt;\"><tbody><tr height=\"21\" style=\"height:15.75pt\">\r\n  <td height=\"21\" class=\"xl66\" width=\"643\" style=\"height:15.75pt;width:482pt\"><p><p class=\"MsoNormal\"><o:p></o:p></p><span style=\"font-size: 1rem;\">There are four underlined sections in the text. Select the\r\none which is wrong.</span></p><p>Hawkeye\r\n  <font class=\"font6\"><u>was</u></font><font class=\"font5\"><u> </u>a character </font><font class=\"font6\"><u>which</u></font><font class=\"font5\"><u> </u>James Fenimore Cooper </font><font class=\"font6\"><u>created</u></font><font class=\"font5\"><u> </u>for The Last of </font><font class=\"font6\"><u>the Mohicans.</u></font></p></td></tr></tbody></table>'),
(174, 3, 2, 1, 0, '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"643\" style=\"width: 482pt;\">\r\n <colgroup><col width=\"643\" style=\"mso-width-source:userset;mso-width-alt:23515;width:482pt\">\r\n </colgroup><tbody><tr height=\"105\" style=\"height:78.75pt\">\r\n  <td height=\"105\" class=\"xl67\" width=\"643\" style=\"height:78.75pt;width:482pt\">In\r\n  order to establish photography as art, members of the Anaesthetic Movement\r\n  modeled their work on classical paintings, even copying the subjects and\r\n  poses popularised by artists of the Classical Period. As the movement gained\r\n  in popularity, photographers made a clear distinction between the elegant,\r\n  artistic photography that conformed to the aesthetic standard used for\r\n  paintings and the work of more realistic photographers that was beginning to\r\n  appear.</td>\r\n </tr>\r\n <tr height=\"21\" style=\"height:15.75pt\">\r\n  <td height=\"21\" class=\"xl67\" style=\"height:15.75pt\"></td>\r\n </tr>\r\n <tr height=\"147\" style=\"height:110.25pt\">\r\n  <td height=\"147\" class=\"xl67\" style=\"height:110.25pt\">Since they were cloudy\r\n  because of the gum bichromate plate that allowed for manual intervention, the\r\n  aesthetic prints were easily distinguished from the more modern prints which\r\n  came to be called straightforward photographs. In contrast, the straightforward\r\n  photographers produced images that were sharp and clear. Whereas the\r\n  proponents of the Aesthetic movement continued to hand colour their\r\n  photographs, adding details and textures to conform to the art of\r\n  printmakers, the philosophy that surrounded the new photography rejected\r\n  manipulation of either the subject matter or the print. The subjects included\r\n  nature in its undisturbed state and people in everyday situations.&nbsp;</td>\r\n </tr>\r\n <tr height=\"21\" style=\"height:15.75pt\">\r\n  <td height=\"21\" class=\"xl67\" style=\"height:15.75pt\"></td>\r\n </tr>\r\n <tr height=\"189\" style=\"height:141.75pt\">\r\n  <td height=\"189\" class=\"xl67\" style=\"height:141.75pt\"><p>A number of major\r\n  exhibitions and the formation of photographic clubs during the late\r\n  nineteenth century provided the impetus for the Photo-Secession Movement.\r\n  Founded by Alfred Steiglitz in New York City in 1902, Photo-Secession had as\r\n  its proposition the promotion of straightforward photography through exhibits\r\n  and publications. One of the publications, Camera Work, has been recognized\r\n  among the most beautiful journals ever produced. By the 1920s, the mechanical\r\n  precision that had once been criticised as a defect by members of the\r\n  Aesthetic Movement had become a hallmark of modern photography. Chiefly\r\n  through the efforts of Steiglitz, modern photography had seceded from\r\n  painting and emerged as a legitimate art form. In summary, the Aesthetic\r\n  Movement rejected reality for beauty, but the Photo-Secessionists embraced\r\n  realism as even more beautiful.</p><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"643\" style=\"width: 482pt;\"><tbody><tr height=\"21\" style=\"height:15.75pt\">\r\n  <td height=\"21\" class=\"xl66\" width=\"643\" style=\"height:15.75pt;width:482pt\">How can\r\n  earlier photographs be distuingished from more modern photographs?</td></tr></tbody></table><p><br></p></td>\r\n </tr></tbody></table>'),
